import React from "react";
import { useState } from "react";
import Modal from "../modal/Modal";
import "./style.css";

const AddBtn = () => {
  const [visible, setVisible] = useState(false);

  return (
    <div
      className="add-btn"
      onClick={() => {
        setVisible(true);
      }}
    >
      <Modal visible={visible} setVisible={setVisible} />
    </div>
  );
};

export default AddBtn;
